import React from "react";
import {Navbar, Nav} from "react-bootstrap"

const Bar=()=>{
    return(
        <>
            <Navbar bg="danger" expand="md">
            <div className="container">
                <Navbar.Brand href="#">
                    <h1 className="text-info">RedBus</h1>
                </Navbar.Brand>
                <Navbar.Toggle aria-controls="redbus"/>
                <Navbar.Collapse id="redbus">
                    <Nav className="ms-auto">
                        <Nav.Link className="btn btn-outline-info text-light me-2" href="#">Home</Nav.Link>
                        <Nav.Link className="btn btn-outline-info text-light me-2" href="#">BookBus</Nav.Link>
                    </Nav>
                </Navbar.Collapse>
            </div>
            </Navbar>
        </>
    );
}
export default Bar;
